import "./CarInstance.css"
import { Link } from 'react-router-dom';

interface Props {
  strImagePath: any,
  strMark: string,
  strPrice: string
}

const CarInstance = (props:Props) => {

  if (props.strMark == "Ferrari A"){
    const image_path = "https://upload.wikimedia.org/wikipedia/commons/thumb/0/06/Ferrari_Daytona_SP3_front_side_at_CF_2022.jpg/1200px-Ferrari_Daytona_SP3_front_side_at_CF_2022.jpg"
  }

  return (
    <Link to="/car"  className="btn car-image-wrapper col-md-4 col-sm-6 col-12">
      <img src={image_path} alt={props.strMark} />
        <p className="car-name">{props.strMark}</p>
        <p className="car-price">{props.strPrice}$/day</p>
    </Link>
  );
}

export default CarInstance;
